import React from 'react';
import './index.css';
import './App.css';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'
import Vocab from './Vocab'
import AllVocab from './AllVocab'
function App(){
    return (
        <div>
            <Router>
                <Switch>
                    <Route path="/vocab/:id">
                        <Vocab  />
                    </Route>                
                </Switch>
            </Router>
        </div>
    )
}

export default App;
